	(6260,'http://www.villagevoice.com/events/adele-2575243/','Adele','adele','Adele  is the hottest singer in the England right now, which only reaffirms the Brits\' centuries-long penchant for masochism. Because as glorious as the young soul diva\'s voice isand it is every second, seemingly impossiblyher belt is one of complete, unvarnished pain, and its evocation is a brutal thing to bear sometimes. The woman has the best, most honest voice of her generation, and what she unearths is pure: Her latest album, 21, dances spryly between pop pacers (\"Rolling in the Deep\") and ballads (\"Someone Like You\"), and both are beautiful and devastating. Keep bringing us to tears, ladyand then point out the man breaking your heart, because we\'d like to kick his ass.',4,'2011-05-18 12:51:35','2011-05-18 12:51:35','http://www.villagevoice.com/events/adele-2575243/','http://vvoice.vo.llnwd.net/e14//6337015.47.jpg','',137,'event_images/2c2b0760a7865dfca18cd60ae0bf22cce271a698.jpg',1,0),
	(6261,'http://www.villagevoice.com/events/cave-in-2571297/','Cave In','cave-in','In their first run, the ever-changing Cave In began as a screamy and fiery hardcore group, then became space-rock astronauts and later turned into some weird amalgamation of the two. Their growing pains were obvious, and it\'s no wonder they had to take a break in 2006. Now, after reforming in 2009, the quartet is releasing their first full-length,  White Silence , on Tuesday. It\'s like they never left: On it, they meander, nick a few Pink Floyd chord changes here, and make oblique astronomy references there. Catch them before they run low on life support again. With Make Do and Mend and James Plotkin.',4,'2011-05-18 12:51:35','2011-05-18 12:51:35','http://www.villagevoice.com/events/cave-in-2571297/','http://vvoice.vo.llnwd.net/e14//6330872.47.jpg','',137,'event_images/5c0ea3d74d57536781de8980b0e7ba294829c711.jpg',1,12),
