	(6227,'http://www.villagevoice.com/events/dont-look-back-the-other-side-of-the-mirror-2575245/','Don\'t Look Back+The Other Side of the Mirror','dont-look-backthe-other-side-of-the-mirror','Not that one ever needs an excuse to indulge in the music and films of Bob Dylan, but nevertheless heres a good oneon May 24, Dylan is turning 70! In honor of the day Mrs. Zimmerman gave birth to the great rock legend, Film Forum is screening his two classic concert films: D.A. Pennebakers  Dont Look Back , which follows Dylan on his tour of the U.K. in 1965 (featuring footage from his performances at the Royal Albert Hall and that unforgettable scene in which he tears apart a reporter from Time), and Murray Lerners  The Other Side of the Mirror , which shows all of Dylans sets at the Newport Folk Festival from 1963 to 1965, the year he allegedly pissed off the folk fans by going electric.  Thursday at 8:30 (with D.A. Pennebaker), Friday at 6:45 (with Murray Lerner).',4,'2011-05-18 12:51:31','2011-05-18 12:51:31','http://www.villagevoice.com/events/dont-look-back-the-other-side-of-the-mirror-2575245/','http://vvoice.vo.llnwd.net/e14//6337037.47.jpg','',29,'event_images/dc9c7176d64390b25de934a0c78fd4f04409e1cb.jpg',1,1),
