	(6551,'http://www.villagevoice.com/events/the-illusion-2559079/','The Illusion','the-illusion','It isnt an exaggeration to consider Tony Kushner a magician of a sort, able to conjure hilarious, hallucinatory, deeply felt, and politically engaged theater. The Signature caps its Kushner season with this revival of his adaptation of the Pierre Corneille tragicomedy about a father who turns to a sorcerer for news of his estranged son.',4,'2011-05-18 12:52:12','2011-05-18 12:52:12','http://www.villagevoice.com/events/the-illusion-2559079/','http://vvoice.vo.llnwd.net/e14//6331227.47.jpg','',125,'event_images/1622a4890e20daef94bd1f9d28dff4f72a73e9f7.jpg',1,0),
	(6552,'http://www.villagevoice.com/events/the-10th-annual-great-night-in-harlem-2575311/','\'The 10th Annual Great Night in Harlem\'','the-10th-annual-great-night-in-harlem','A play on \"A Great Day in Harlem,\" the iconic 1958 photograph of 57 jazz legends posed on a front stoop on 126th Street, the Jazz Foundation of America brings together a constellation of more than 40 stars across several genres. The evening honors the unsung heroes of the back line, elder statesmen of the studio now fallen on hard times. This year, organizers intend to raise $2 million--not too lofty a goal, considering the stellar lineup includes Dr. John, Donald Fagen, Lou Reed, Macy Gray, and more.',4,'2011-05-18 12:52:12','2011-05-18 12:52:12','http://www.villagevoice.com/events/the-10th-annual-great-night-in-harlem-2575311/','http://vvoice.vo.llnwd.net/e14//6337537.47.jpg','',137,'event_images/a54cbd56eddc5515d251f49a7f9a05439852a13d.jpg',1,0),
