	(6558,'http://www.villagevoice.com/events/the-bungalows-of-rockaway-a-documentary-screening-with-jennifer-callahan-2503958/','The Bungalows of Rockaway: A Documentary Screening with Jennifer Callahan','the-bungalows-of-rockaway-a-documentary-screening-','The first bungalow went up in Rockaway in 1905; by 1933 there were over 7000 on the peninsula; today, fewer than 450 remain. This documentary looks at working class leisure, public beach access, community identity, and public culture.',4,'2011-05-18 12:52:13','2011-05-18 12:52:13','http://www.villagevoice.com/events/the-bungalows-of-rockaway-a-documentary-screening-with-jennifer-callahan-2503958/','','',34,'',1,2),
