	(6560,'http://www.villagevoice.com/events/jd-allen-trio-2567214/','JD Allen Trio','jd-allen-trio','You can call Allen a jukebox of sorts. Melody after melody spills from his tenor sax, and each is bolstered by one of the more unique rhythm sections in town. The new  Victory!  works the band\'s template of catchy tunes and pithy improvs, but the music seems to be throwing more punches this time out. Last month at Smalls, there was lots of liftoff in the air.',4,'2011-05-18 12:52:13','2011-05-18 12:52:13','http://www.villagevoice.com/events/jd-allen-trio-2567214/','http://vvoice.vo.llnwd.net/e14//6330866.47.jpg','',137,'event_images/f7a90ccf1f6b554a8392ebf98ab32f44bac265a5.jpg',1,15),
