	(6758,'http://www.villagevoice.com/events/till-von-sein-atomly-2575364/','Till Von Sein+Atomly','till-von-seinatomly','Till Von Sein grew up in northern Germany listening to hip-hop; now he resides in Berlin and makes the sort of soulful tech house records that Wolf + Lamb or Soul Clap would spin. North Dakota-born Atomly has experimented with breakcore and IDM; these days, he more often plays late-night techno influenced by minimalism and dubstep. His sets at the Bunker and Kiss & Tell prove he can pull any genre into a good time. With 34th Street John, Orhun Oguzulgen, and Bart Stankiewicz, with visuals by Tripl-E.',4,'2011-05-18 12:52:38','2011-05-18 12:52:38','http://www.villagevoice.com/events/till-von-sein-atomly-2575364/','http://vvoice.vo.llnwd.net/e14//6337636.47.jpg','',137,'event_images/99a5c4fefa7f48cf0805e2318de2fd3e952a63d4.jpg',1,0),
