	(6768,'http://www.villagevoice.com/events/manhattan-cocktail-classic-2561672/','Manhattan Cocktail Classic','manhattan-cocktail-classic','Carrie Bradshaw is not the only New Yorker who loves cocktailsher classic cosmopolitans represent only a small taste of the drinks mixologists pour nowadays. Now in its second year, the  Manhattan Cocktail Classic  is back to prove that cocktails are more than just cosmos, and cocktail parties are more than just standing around, sipping a drink. This five-day-long festival spans bars, restaurants, art galleries, barbershops, librariesyou name it. You can even find the party venturing out into Brooklyn and Queens. At any event, you may listen in on stories from behind the bar, learn a little history, or discover what it takes to earn the title of mixologist. Expect seminars, tastings, pairings, dancing, cruises, concerts, fashion and art shows, film screenings, croquet tournaments, and whatever else your imagination can muster. Just remember to think outside the cosmo.',4,'2011-05-18 12:52:40','2011-05-18 12:52:40','http://www.villagevoice.com/events/manhattan-cocktail-classic-2561672/','http://vvoice.vo.llnwd.net/e14//6316026.47.jpg','',38,'event_images/bb07d60907a9cfd3f37dc4c4825d217edc6222a4.jpg',1,0),
