	(6918,'http://www.villagevoice.com/events/amor-de-dias-2571565/','Amor de Dias','amor-de-dias','It\'s a wonderful world we live in when the phrase \"psych-folk tropicalia supergroup\" can be thrown around without the bat of an eyelash. Amor de Dias, the collaborative effort of Lupe Nunez- Fernandez of Pipas and the Clientele\'s Alasdair MacLean, is usually placed in such a genre.  Street of the Love of Days , their debut, is just out on Merge. With Damon & Naomi, veterans of gossamer sounds and art project dreams.',4,'2011-05-18 12:52:59','2011-05-18 12:52:59','http://www.villagevoice.com/events/amor-de-dias-2571565/','http://vvoice.vo.llnwd.net/e14//6331027.47.jpg','',137,'event_images/efe6de9249e5a30b46d3798a627bfc7d13753162.jpg',1,3),
