	(7054,'http://www.villagevoice.com/events/fleet-foxes-2559189/','Fleet Foxes','fleet-foxes','The bearded boys of  Fleet Foxes  have spoken at length about the various difficulties they faced in making their tellingly titled new album. But like the Seattle indie-folk act\'s 2008 debut,  Helplessness Blues  doesn\'t betray much evidence of a slogits lush vocal harmonies and strummy-strum arrangements float out of the speakers like smoke from the end of a clove cigarette. This week, the band hits town for a pair of United Palace gigs sure to showcase those harmonies in all their naturally reverberant glory. Fellow Seattle-ites the Cave Singers (with a dude who used to be in Pretty Girls Make Graves) open both shows.',4,'2011-05-18 12:53:16','2011-05-18 12:53:16','http://www.villagevoice.com/events/fleet-foxes-2559189/','http://vvoice.vo.llnwd.net/e14//6304193.47.jpg','',137,'event_images/ecf4f8dbb41cd6001f2321eb50aa11e8767d1e91.jpg',1,0),
