	(7263,'http://www.villagevoice.com/events/looking-at-music-3-0-2376070/','Looking at Music 3.0','looking-at-music-30','The Beastie Boys, Run-DMC, Sonic Youthif you missed living in the city in the 80s and 90s (or were too young to apprecaite it),  Looking at Music 3.0  takes you back to New Yorks glory days, when art thrived on city walls, underground clubs, and alternative space. This show, the third in a series that explores the influence of music on contemporary art practices, features about 70 pieces that center around the birth of remix culture and the activism that arose in response to the AIDS crisis, the citys financial problems, and the rampant drug use destroying neighborhoods. Artists included are Public Enemy, Kathleen Hanna and Le Tigre, Keith Haring, Christian Marclay, Lee Quinones, and Miranda July, who founded Joanie 4 Jackie, a video chain letter.',4,'2011-05-18 12:53:43','2011-05-18 12:53:43','http://www.villagevoice.com/events/looking-at-music-3-0-2376070/','http://vvoice.vo.llnwd.net/e14//5940650.47.jpg','',127,'event_images/44b44550a6bbc88732bb08041910c5635c8d7ac7.jpg',1,193),
