	(7254,'http://www.villagevoice.com/events/fca-manhattan-cup-2575255/','FCA Manhattan Cup','fca-manhattan-cup','We in the New York area are surrounded by water, but how often do we get a chance to go fishing? You can hit the high seas with your tackle and bait today, courtesy of the Fisherman\'s Conservation Association when they host their annual  FCA Manhattan Cup . The FCA is a certified not-for-profit organization dedicated to promoting the well-being of New York, New Jersey, and Connecticut waters. Among their priorities are fighting the dumping of toxic waste in Jamaica Bay and protecting the striped bass game fish. The Manhattan Cup kicks off at 7:30 a.m. with all boats leaving the dock by 9. This is the tri-state\'s largest catch-and-release tournament as anglers fish for striped bass, bluefish, and weakfish. The tournament is followed by a dinner with food, beer, and raffles. This is a unique opportunity but a day on a boat is not inexpensiveyou must be pre-registered and expect to pay around $500. But how often do you get to be, as Bing Crosby and Louis Armstrong sang, \"Gone fishin\' instead of just a-wishin\' \"?',4,'2011-05-18 12:53:42','2011-05-18 12:53:42','http://www.villagevoice.com/events/fca-manhattan-cup-2575255/','http://vvoice.vo.llnwd.net/e14//6337049.47.jpg','',3,'event_images/72a8a03bdeaa4a7944277a46c510bdec6b1e3317.jpg',1,56),
