	(7488,'http://www.villagevoice.com/events/smorgasburg-2575257/','Smorgasburg','smorgasburg','Ah, the Brooklyn Flea . . . your favorite Sunday flea-market sanctuary, which fulfills all of your eclectic needs, but, alas, has never fulfilled your taste-buds. That is, until now!  Smorgasburg , Brooklyn Flea\'s first food market, launches today and will be in Williamsburg (hence the \"burg\") every Saturday. More than a hundred vendors will be selling hot food, packaged goods, cheese/dairy, meat/fish, sweets, and baked goods (all from local vendors and growers, of course) along with kitchenware, too. The outdoor space will also come with a kids\' play area. If only we could have a Smorgasburg and  Brooklyn Flea side-by-side, we\'d be heaven.',4,'2011-05-18 12:54:13','2011-05-18 12:54:13','http://www.villagevoice.com/events/smorgasburg-2575257/','http://vvoice.vo.llnwd.net/e14//6337054.47.jpg','',38,'event_images/2b2add3ea0ac78931379b062c43de6baaff8a3d1.jpg',1,0),
