	(7516,'http://www.villagevoice.com/events/union-square-crossroads-of-new-york-950774/','Union Square: Crossroads of New York','union-square-crossroads-of-new-york','This tour, created by Union Square Partnership and Big Onion Walking Tours, is a 90-minute exploration of the social and political history of the Union Square neighborhood through discussions of the people, history, architecture, and forces that have shaped this community.',4,'2011-05-18 12:54:17','2011-05-18 12:54:17','http://www.villagevoice.com/events/union-square-crossroads-of-new-york-950774/','','',117,'',1,0),
