	(7513,'http://www.villagevoice.com/events/elastic-city-walking-tour-1823707/','Elastic City Walking Tour','elastic-city-walking-tour','Artist Todd Shalom founded Elastic City to carry out a specific mission: To push on the walking tour tradition and reveal new ways of experiencing New York. The various walks explore urban design, typography, architecture, poetry, ritualistic performance, sound art and psychotherapy. Among the inaugural season offerings are a walk with theater director Niegel Smith, in which participants will brave local security in downtown Manhattan and trail the routines of our elected officials in public spaces; a walk to the World Trade Center site by psychotherapist Robert Mauksch that will incorporate landscape embodiment\" techniques; and a soundwalk around DUMBO by Daniel Neumann.',4,'2011-05-18 12:54:17','2011-05-18 12:54:17','http://www.villagevoice.com/events/elastic-city-walking-tour-1823707/','','',171,'',1,0);
